import React from 'react';
import './App.css';
import { BigCard } from "./Components/BigCard/BigCard";
import { PageSection} from "./Components/PageSection/PageSection";

const quemSouBig = {
  imagem: require("./imagens/samuel.jpg"),  
  titulo: "Samuel Quaresma Oliveira",
  texto: "Meu texto explicativo"
}



const tipoSessao = {
  tipo: "dadosPessoais"
}

function App() {
  return (
    <div className="App">
      <PageSection nomeSessao={tipoSessao.tipo}>
        <h1>Dados Pessoais</h1>
        <BigCard imagem={quemSou.imagem} titulo={quemSou.titulo} texto={quemSou.texto} />
      </PageSection>
    </div>
  );
}

export default App;
